import React from "react";

const SuggestionPanel = () => {
  return (
    <div className="suggestion-panel">
      <div className="suggestion-panel__header">
        <h3 className="suggestion-panel__title">Suggestions</h3>
        <p className="suggestion-panel__subtitle">People you may know</p>
      </div>
      <div className="suggestion-panel__body">
        <div className="suggestion-panel__suggestion">
          <div className="suggestion-panel__suggestion-avatar">
            <img src="https://picsum.photos/100/100" alt="Avatar" />
          </div>
          <div className="suggestion-panel__suggestion-info">
            <h4 className="suggestion-panel__suggestion-name">John Doe</h4>
            <p className="suggestion-panel__suggestion-username">@johndoe</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SuggestionPanel;
